import React from "react";

function ContactInfo({ prevPage }) {
  return (
    <div>
      <h3 className="text-xl font-semibold mb-4">Contact Information</h3>
      <label className="block mb-2">
        Phone:
        <input type="text" placeholder="Enter your phone number" className="w-full px-3 py-2 border border-gray-300 rounded mt-1" />
      </label>
      <label className="block mb-4">
        Address:
        <input type="text" placeholder="Enter your address" className="w-full px-3 py-2 border border-gray-300 rounded mt-1" />
      </label>
    </div>
  );
}

export default ContactInfo;
